import React from 'react'
import Image from 'react-bootstrap/Image';
import Navigation from '../navigation/Navigation'
import style from '../quiz/'

function Quiz() {
  return (
    <div>
        <Navigation />
        <Image className={style.img} src="../../quiz.webp" rounded />
    </div>
  )
}

export default Quiz
